import React from 'react';
import { View, TextInput, Text, ImageBackground, TouchableOpacity, Button, StyleSheet } from 'react-native';



function Ajuda({navigation}){
  return(
    <View > 
      <View style={styles.fundoWhite}>
        <Text style={styles.titulo}>Ajuda</Text>
       
        <View style={{flex: 1}}>
          <WebView
          style={ {  marginTop: (Platform.OS == 'ios') ? 20 : 0,} }
          javaScriptEnabled={true}
          domStorageEnabled={true}
          source={{uri: 'https://www.youtube.com/embed/'+this.state.pictureData.idVideo }}
            />
        </View>
      </View>
      
      <View style={styles.fundoBlue}>
      </View>
      
   </View>
    
  )
};



const styles = StyleSheet.create({
  fundoWhite: {     
      height:"40%",
      backgroundColor : "#fff",
      alignItems: 'center',
      justifyContent: 'center',
      },

  fundoBlue: {
    
    height:"60%",
    backgroundColor : "#219EBC",
    alignItems: 'center',
    justifyContent: 'center',
  },

  titulo: {
    marginTop: 25,
    fontSize: 30,
    color: "#219ebc",
    fontWeight: "bold",
    marginLeft: 10,
    textAlign: "center" 
  },

  video: {
    borderColor: "black",
  }
      

  })


  export default Ajuda;
